import ExpenseItem from "./ExpenseItem";

function Expenses (props) {

    const expensesTitle = props.title;
    const expensesAmount = props.amount;
    const expensesDate = props.date;
    return (<div>
        <ExpenseItem
        title={expensesTitle[0]}
        amount={expensesAmount[0]}
        date={expensesDate[0]}
      />
      <ExpenseItem
        title={expensesTitle[1]}
        amount={expensesAmount[1]}
        date={expensesDate[1]}
      />
      <ExpenseItem
        title={expensesTitle[2]}
        amount={expensesAmount[2]}
        date={expensesDate[2]}
      />
      <ExpenseItem
        title={expensesTitle[3]}
        amount={expensesAmount[3]}
        date={expensesDate[3]}
      />
      </div>
    )
}

export default Expenses;
